import { useEffect } from "react";
function Password(props) {

    const {delta,setPassowrd,passVibe} = props

    useEffect(()=>{
        if(delta < 100){
          setPassowrd('weak')
        }
        if(delta >= 100 && delta <= 1000000){
            setPassowrd('medium')
        }
        if(delta > 1000000){
            setPassowrd('strong!')
        }
      },[setPassowrd,delta])

      function changePassVibe(){
        if(delta >= 100){
            passVibe(true);
        }
      }


  return (
    <div>
        {changePassVibe}
    </div>
  );
}

export default Password;
